  }

  handleToggle=()=>{
    this.setState({
      isOpen: !this.state.isOpen
    })
  }

  render(){
    return(
      <div className='navbar'>
        <div className='nav-center'>
          <div className='nav-header'>

            <Link to='/Home'>
              <img src={logo} alt='Beach Resort'/>
            </Link>
              <Link to='/Rooms'>Rooms </Link>
          </div>
        </div>
